    constructor(props) {
        super(props)

        this.state = {
            loading:false,
            redirect: false,
            userprofile:[],
            totalmonthbalance:"",
            totalbalance:"", 
            totalcourse:"",
            courseinfos:"",
            coursesrc: "",
            coursename:""
        }
    }
    componentWillMount(){
        const auth= localStorage.getItem('userprofile')

        if(auth == undefined || auth ==null){
            this.setState({redirect:true})
        }
        else{
            let testdated = Moment().format()
            api.post("/auth/me",{token:JSON.parse(auth).token}).then(res=>{
                // console.log("userprofile",res.data)
                if(res.data.success==true){

                    this.setState({userprofile:res.data.user})
                    api.get(`/instructor/getdata/${parseInt(res.data.user.id)}`).then(resu=>{
                        // console.log("inside userdata",resu.data)
                        if(resu.data.success==true){
                            let temp =[]
                            temp = resu.data.data.rows

                            let totalbalances=0;
                            let allbalance=0;
                            var now = Moment(new Date()); //todays date
                            let courses = "";
                            temp.map(elem =>{
                                allbalance+= Number(elem.income.substring(1))
                                var end = Moment( elem.course.createdAt.substring(0,10)); // another date
                                var duration = Moment.duration(now.diff(end));
                                var days = duration.asDays();

                                if(parseInt(days) <=30){
                                    totalbalances += Number(elem.income.substring(1))
                                    // this.setState({totalmonthbalance:totalbalances});
                                }
                                courses+=elem.course.id+","

                                // console.log("elem.courseid",elem.course.id)
                            })
                            console.log("courses",courses)
                            this.setState({courseinfos:courses,userdata:resu.data.data.rows,totalcourse:resu.data.data.count, totalbalance:allbalance, totalmonthbalance:totalbalances})


                        }else{
                            console.log("error coccured!!!")
                        }
                    })
                }
                console.log("hello!!!!!")
                console.log("courseinfos",this.state.courseinfos)
            })

